}{2}=\\\\frac{1 \\\\ \\\\times \\\\ 10}{2 \\\\ \\\\times \\\\ 10}=\\\\frac{10}{20}\\\\)</p>\\n\\n<p>\\\\(\\\\frac{1}{20}\\\\) &lt; \\\\(\\\\frac{5}{20}\\\\) &lt; \\\\(\\\\frac{10}{20}\\\\) &lt; \\\\(\\\\frac{12}{20}\\\\) &lt; \\\\(\\\\frac{14}{20}\\\\)</p>\\n\\n<p>Therefore, \\\\(\\\\frac{1}{20}\\\\) &lt; \\\\(\\\\frac{1}{4}\\\\) &lt; \\\\(\\\\frac{1}{2}\\\\) &lt; \\\\(\\\\frac{3}{5}\\\\) &lt; \\\\(\\\\frac{7}{10}\\\\)</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"4fda747c-04dc-46b0-b9e3-8b179f256862\"}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"Solution\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Solution\"},\"subContentId\":\"b5ae5d37-9d15-460d-a9e0-eed12376f571\"}],\"i10n\":{\"previousLabel\":\"Previous\",\"nextLabel\":\"Next\",\"closeLabel\":\"Close\"}},\"library\":\"H5P.DocumentationTool 1.8\",\"metadata\":{\"contentType\":\"Documentation Tool\",\"license\":\"U\",\"title\":\"Arranging Fractions\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Arranging Fractions\"},\"subContentId\":\"0d1200b1-a4a1-42ce-9202-90c815e166a1\"},\"useSeparator\":\"disabled\"},{\"content\":{\"params\":{\"text\":\"<h3><strong>Problem 2</strong></h3>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"c2a76a3b-c15a-4237-88f5-e1a706326e09\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"taskDescription\":\"Documentation tool\",\"pagesList\":[{\"params\":{\"elementList\":[{\"params\":{\"contentName\":\"Image\",\"decorative\":true,\"file\":{\"path\":\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAA+gAAAEaCAIAAAANBOqIAAAAAXNSR0IArs4c6QAAAAlwSFlzAAAN/wAADf8B9IqyiQAAQABJREFUeAHs/VuSHDmyJewyeAkyK6un0K8 maining characters: @chars\",\"taskDescription\":\"<p>Who is right? Explain.</p>\\n\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"d27c0e9a-17af-484e-8820-24324d3560b5\"}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"Problem\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Problem\"},\"subContentId\":\"e58181fd-6efd-4936-81c6-1dd0edd643e1\"},{\"params\":{\"elementList\":[{\"params\":{\"text\":\"<p>Lilianne has finished \\\\(\\\\frac{3}{4}\\\\) of the homework. </p>\\n\\n<p>Samah has finished \\\\(\\\\frac{4}{8}\\\\) of the homework. </p>\\n\\n<p>Tanya has finished \\\\(\\\\frac{4}{16}\\\\) of the homework. </p>\\n\\n<p>To be able to compare the fractions, we need to find a common denominator. 4, 8, and 16 have 16 as a common multiple.</p>\\n\\n<p>Lilianne: \\\\(\\\\frac{3}{4}=\\\\frac{3 \\\\ \\\\times \\\\ 4}{4 \\\\ \\\\times \\\\ 4}=\\\\frac{12}{16}\\\\)</p>\\n\\n<p>Samah: \\\\(\\\\frac{4}{8}=\\\\frac{4 \\\\ \\\\times \\\\ 2}{8 \\\\ \\\\times \\\\ 2}=\\\\frac{8}{16}\\\\)</p>\\n\\n<p>Tanya: \\\\(\\\\frac{4}{16}\\\\)</p>\\n\\n<p>Therefore, Lilianne has done most of the homework because \\\\(\\\\frac{12}{16}\\\\) &gt; \\\\(\\\\frac{8}{16}\\\\) &gt; \\\\(\\\\frac{4}{16}\\\\).</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"9607eca4-4217-4dfa-a079-ea580fa6e386\"}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"Solution\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Solution\"},\"subContentId\":\"7df34c31-9a2d-4435-9551-93d61f4f09ff\"}],\"i10n\":{\"previousLabel\":\"Previous\",\"nextLabel\":\"Next\" ano concert. </p>\\n\\n<p>Samer can play \\\\(\\\\frac{2}{4}\\\\) of his melody notes.</p>\\n\\n<p>Fadi can play \\\\(\\\\frac{3}{10}\\\\) of his melody notes.</p>\\n\\n<p>Tamer can play \\\\(\\\\frac{1}{5}\\\\) of his melody notes.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"a5a0c689-0d3d-4be2-b2ee-2a8112679d9c\"},{\"params\":{\"inputFieldSize\":\"10\",\"requiredField\":true,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"<p>Which of these boys is most ready for the piano concert? Explain.</p>\\n\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"229eff93-300d-4b0f-98cf-b1d88eb9cdb0\"}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"Problem\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Problem\"},\"subContentId\":\"51c750a8-c3de-4996-aa81-6c49b78fc0be\"},{\"params\":{\"elementList\":[{\"params\":{\"text\":\"<p>Samer can play \\\\(\\\\frac{2}{4}\\\\) of his melody notes.</p>\\n\\n<p>Fadi can play \\\\(\\\\frac{3}{10}\\\\) of his melody notes.</p>\\n\\n<p>Tamer can play \\\\(\\\\frac{1}{5}\\\\) of his melody notes.</p>\\n\\n<p>To compare the fractions, we need to find the common multiple of the denominators and calculate the equivalent fractions.</p>\\n\\n<p>The common multiple of 4, 5, and 10 is 20.</p>\\n\\n<p>Samer: \\\\(\\\\frac{2}{4}=\\\\frac{2 \\\\ \\\\times \\\\ 5}{4 \\\\ \\\\times \\\\ 5}=\\\\frac{10}{20}\\\\)</p>\\n\\n<p>Fadi: \\\\(\\\\frac{3}{10}=\\\\frac{3 \\\\ \\\\times \\\\ 2}{10 \\\\ \\\\times \\\\ 2}=\\\\frac{6}{20}\\\\)</p>\\n\\n<p>Tamer: \\\\(\\\\frac{1}{5}=\\\\frac{1 \\\\ \\\\times \\\\ 4}{5 \\\\ \\\\times \\\\ 4}=\\\\frac{4}{20}\\\\)</p>\\n\\n<p>Thus, Samer is the most ready
